import React from 'react'; 
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Signup from './components/Signup'; // Import the Signup component
import DoctorHome from './components/doctorHome'; // Updated path to DoctorHome
import ClinicalHome from './components/ClinicalHome';
import AdminHome from './components/AdminHome';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/signup" element={<Signup />} /> 
        <Route path="/doctor-home" element={<DoctorHome />} /> {/* Updated path */}
        <Route path="/clinical-home" element={<ClinicalHome />} />
        <Route path="/admin-home" element={<AdminHome />} />
      </Routes>
    </Router>
  );
}

export default App;
